from cryptography.fernet import Fernet

def strt(data, layers):
    main = data

    for _ in range(layers):
        key, data = main[:44].encode(), main[44:]
        encrypted_data = bytes(data, 'utf-8')
        decrypted_data = Fernet(key).decrypt(encrypted_data).decode()
        main = decrypted_data

    return main  

